script: |
  super -f text -I q6361.spq | sort > q6361.out

inputs:
  - name: q6361.spq
    data: |
      SELECT - col1 AS col1, col1 FROM tab1 (FORMAT parquet) WHERE - 35 * - - 1 - - + ( + 90 ) <> ( col1 );
  - name: tab1

outputs:
  - name: q6361.out
    data: |
      -14	14
      -47	47
      -5	5
